import { Box, Container, Typography } from "@mui/material";

function Etusivu() {
  <Box
    sx={{
      bgcolor: "background.paper",
      pt: 8,
      pb: 6,
    }}
  >
      <Container maxWidth="sm">
          <Typography
          component="h1"
          variant="h2"
          align="center"
          gutterBottom>
            Kysely 1
          </Typography>
      </Container>
  </Box>;
}

export default Etusivu;
